/* ===== LOGIN SYSTEM ===== */
let isRegister = false;
let generatedCode = "";

function toggleMode() {
    isRegister = !isRegister;
    authTitle.innerText = isRegister ? "Đăng Ký" : "Đăng Nhập";
    verifyBox.classList.toggle("hidden", !isRegister);
    message.innerText = "";
}

function strongPassword(pw) {
    return /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[\W_]).{8,}$/.test(pw);
}

function submitAuth() {
    let email = emailInput.value.trim();
    let password = passwordInput.value.trim();
    let users = JSON.parse(localStorage.getItem("users") || "{}");

    if (!email.includes("@")) { message.innerText = "Email không hợp lệ"; return; }
    if (!strongPassword(password)) { message.innerText = "Mật khẩu chưa đủ mạnh"; return; }

    if (isRegister) {
        if (users[email]) { message.innerText = "Email đã tồn tại"; return; }

        if (!generatedCode) {
            generatedCode = Math.floor(100000 + Math.random() * 900000).toString();
            alert("Mã xác minh: " + generatedCode);
            message.innerText = "Nhập mã xác minh";
            return;
        }

        if (verifyCode.value !== generatedCode) {
            message.innerText = "Sai mã xác minh";
            return;
        }

        users[email] = password;
        localStorage.setItem("users", JSON.stringify(users));
        message.innerText = "Đăng ký thành công";
        generatedCode = "";
        return;
    }

    if (users[email] !== password) { message.innerText = "Sai tài khoản"; return; }

    authBox.classList.add("hidden");
    menuPage.classList.remove("hidden");
}

function logout() {
    menuPage.classList.add("hidden");
    authBox.classList.remove("hidden");
}

/* ===== FEATURE SYSTEM ===== */

const features = [
    "AimLock 60%", "Nhe Tam", "Tang Nhay", "Bam Dau", 
    "Mượt Tâm ", "Lock Tâm Nhẹ", "Buff Dpi", "Ổn Định Tâm", "Tâm Khoá 90%"
];

features.forEach((name, i) => {
    let div = document.createElement("div");
    div.style.display = "flex";
    div.style.justifyContent = "space-between";
    div.style.marginBottom = "10px";

    div.innerHTML = `
        <span>${name}</span>
        <label class="switch">
            <input type="checkbox" onchange="toggleFeature(${i})">
            <span class="sliderSwitch"></span>
        </label>
    `;
    featureList.appendChild(div);
});

